src:
Афиша недели бара «7 Пятниц»
Музыкальное настроение подарят группы Bek, Di Live, Nashwan и другие.

04 Nov 2019


с 4 по 10 ноября



Семь Пятниц


Бар «7 Пятниц» приглашает на вечеринки.

В программе:


4 ноября — ВИА "Халиф", караоке, DJ Pashkov;
5 ноября — Radio, DJ Zoff;
6 ноября — Bek, DJ Niki;
7 ноября — Nashwan, DJ Ruxx;
8 ноября — ВИА "Халиф", DJ Pashkov;
9 ноября — Nashwan, DJ Samwell;
10 ноября — BetweenUs, DJ Zeman.

Резерв столиков по номеру: (+99893) 396-7575.

